import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';
import { FaCheckCircle, FaGraduationCap, FaEnvelope, FaCalendarAlt, FaClock } from 'react-icons/fa';

const AboutCTA = () => {
  const [timeLeft, setTimeLeft] = useState({
    days: 7,
    hours: 12,
    minutes: 45,
    seconds: 0
  });

  // Timer countdown logic
  useEffect(() => {
    const timer = setTimeout(() => {
      if (timeLeft.seconds > 0) {
        setTimeLeft({ ...timeLeft, seconds: timeLeft.seconds - 1 });
      } else if (timeLeft.minutes > 0) {
        setTimeLeft({ 
          ...timeLeft, 
          minutes: timeLeft.minutes - 1,
          seconds: 59
        });
      } else if (timeLeft.hours > 0) {
        setTimeLeft({
          ...timeLeft,
          hours: timeLeft.hours - 1,
          minutes: 59,
          seconds: 59
        });
      } else if (timeLeft.days > 0) {
        setTimeLeft({
          ...timeLeft,
          days: timeLeft.days - 1,
          hours: 23,
          minutes: 59,
          seconds: 59
        });
      }
    }, 1000);
    
    return () => clearTimeout(timer);
  }, [timeLeft]);

  return (
    <section className="about-cta-section py-80">
      <div className="container">
        <div className="row justify-content-center">
          <div className="col-lg-10">
            <motion.div 
              className="about-cta-wrapper"
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ duration: 0.8 }}
            >
              <div className="about-cta-bg-overlay"></div>
              <div className="about-cta-pattern"></div>
              <div className="about-cta-shape-1"></div>
              <div className="about-cta-shape-2"></div>
              
              <div className="about-cta-container">
                <div className="row align-items-center">
                  <div className="col-lg-7">
                    <div className="about-cta-content">
                      <motion.div 
                        className="about-cta-badge"
                        initial={{ opacity: 0, scale: 0.8 }}
                        whileInView={{ opacity: 1, scale: 1 }}
                        viewport={{ once: true }}
                        transition={{ delay: 0.2, duration: 0.5 }}
                      >
                        <FaCalendarAlt className="me-2" />
                        <span>Limited Time Offer</span>
                      </motion.div>
                      
                      <motion.h2
                        className="about-cta-title"
                        initial={{ opacity: 0, y: 20 }}
                        whileInView={{ opacity: 1, y: 0 }}
                        viewport={{ once: true }}
                        transition={{ delay: 0.3, duration: 0.6 }}
                      >
                        Ready to Start Your Medical Education Journey?
                      </motion.h2>
                      
                      <motion.p
                        className="about-cta-text"
                        initial={{ opacity: 0, y: 20 }}
                        whileInView={{ opacity: 1, y: 0 }}
                        viewport={{ once: true }}
                        transition={{ delay: 0.4, duration: 0.6 }}
                      >
                        Join thousands of successful medical students who have transformed their careers with our comprehensive NExT exam preparation courses.
                      </motion.p>
                      
                      <motion.ul 
                        className="about-cta-features"
                        initial={{ opacity: 0, y: 20 }}
                        whileInView={{ opacity: 1, y: 0 }}
                        viewport={{ once: true }}
                        transition={{ delay: 0.5, duration: 0.6 }}
                      >
                        <li className="cta-feature">
                          <FaCheckCircle className="feature-icon" />
                          <span>Expert-led courses and workshops</span>
                        </li>
                        <li className="cta-feature">
                          <FaCheckCircle className="feature-icon" />
                          <span>Comprehensive study materials</span>
                        </li>
                        <li className="cta-feature">
                          <FaCheckCircle className="feature-icon" />
                          <span>Personalized mentorship program</span>
                        </li>
                        <li className="cta-feature">
                          <FaCheckCircle className="feature-icon" />
                          <span>Access to practice question banks</span>
                        </li>
                      </motion.ul>
                      
                      <motion.div 
                        className="about-cta-buttons"
                        initial={{ opacity: 0, y: 20 }}
                        whileInView={{ opacity: 1, y: 0 }}
                        viewport={{ once: true }}
                        transition={{ delay: 0.7, duration: 0.6 }}
                      >
                        <Link to="/courses" className="btn btn-primary btn-lg cta-btn-primary">
                          <FaGraduationCap className="me-2" />
                          Explore Our Courses
                        </Link>
                        <Link to="/contact" className="btn btn-outline-light btn-lg cta-btn-secondary">
                          <FaEnvelope className="me-2" />
                          Contact Us
                        </Link>
                      </motion.div>
                    </div>
                  </div>
                  
                  <div className="col-lg-5">
                    <motion.div 
                      className="about-cta-timer-container"
                      initial={{ opacity: 0, x: 30 }}
                      whileInView={{ opacity: 1, x: 0 }}
                      viewport={{ once: true }}
                      transition={{ delay: 0.6, duration: 0.6 }}
                    >
                      <div className="cta-timer-header">
                        <FaClock className="timer-icon" />
                        <p className="timer-label">Early Bird Registration Ends In:</p>
                      </div>
                      <div className="cta-timer-display">
                        <div className="timer-unit">
                          <span className="timer-number">{timeLeft.days}</span>
                          <span className="timer-text">Days</span>
                        </div>
                        <div className="timer-separator">:</div>
                        <div className="timer-unit">
                          <span className="timer-number">{timeLeft.hours}</span>
                          <span className="timer-text">Hours</span>
                        </div>
                        <div className="timer-separator">:</div>
                        <div className="timer-unit">
                          <span className="timer-number">{timeLeft.minutes}</span>
                          <span className="timer-text">Minutes</span>
                        </div>
                        <div className="timer-separator">:</div>
                        <div className="timer-unit">
                          <span className="timer-number">{timeLeft.seconds}</span>
                          <span className="timer-text">Seconds</span>
                        </div>
                      </div>
                      <div className="cta-timer-footer">
                        <span className="discount-badge">Save 25% Today!</span>
                      </div>
                    </motion.div>
                  </div>
                </div>
              </div>
            </motion.div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default AboutCTA;
